class MainPage extends Component {
    // componentDidMount(){
    //     console.log('씨발 로드안되냐??');
    //     return API.GET_MainPage();
    // }

    render() {
        return (
            <div>
              <Route exact path = "/" component={CustomerMain}/>
            </div>
        );
    }
}

export default MainPage;
